import React from 'react';
import axios from 'axios';
import { List, Typography } from 'antd';

export default class admin extends React.Component {
    state = {
        user: [],
    };

    componentDidMount() {
        axios.get('http://localhost:3065/api/agari/').then(res => {
            console.log(res);
        });
    }
}
